import {combineReducers} from 'redux';
import tmReducer from './teamMemberReducer';
import timerReducer from './timerReducer';

const rootReducer = combineReducers({
    tmReducer: tmReducer,
    timerReducer: timerReducer
});

export default rootReducer;
